import React from 'react';
import '../styles/Menu.css';

const Menu = ({ children, position, isVisible, page }) => {
    return (
        <div className={`menu ${isVisible ? 'visible' : ''}`} style={{ top: `${position.y}px`, left: `${position.x}px`}}>
            {children}
        </div>
    );
};

export default Menu;
